import {IntlProvider, FormattedMessage, FormattedNumber} from 'react-intl'

const messagesInFrench = {
  name: "Karur Gold Finance",
}

const About = () => {
    return(

    <div>

<IntlProvider messages={messagesInFrench} locale="fr" defaultLocale="en">
      <p>
    <div className="lg:flex mt-24">

             <div className=" lg:pl-24 lg:w-2/4 ">
               <img alt="..." className="align-middle border-none max-w-full h-auto rounded-lg" src="/Image/Banner1.jpg" />
           </div>

           <div className="lg:w-2/4 lg:pr-24  lg:ml-12 mt-8 sm:text-center">
             <b className="text-2xl"> <FormattedMessage
          id="name"
          defaultMessage=""
          values={{ts: Date.now()}}
        /> </b>
             <p>Our story began in 1991 in Kerala. We have been producing natural and organic fruits and vegetables and sourced those to the local market. Our passion for natural products and our nose for food trends led our company to the next big step now.</p>
           </div>

         </div>
         </p>
    </IntlProvider>

         </div>

    )}

export default About;
